import React, { Component } from 'react';
import { Switch, Route, Link } from 'react-router-dom'
import Button from 'react-bootstrap/button';
import { translate } from "react-i18next";

import './navbar.css';


class Navbar extends Component {

  render() {
    const { t } = this.props;

    return (
      <div className="navbar__container">
      <div className="navbar__links">
      <img src="/assets/logo-cci.svg" alt="Circle CI Logo" />
      <Link to="/Beetroots/">Beetroots</Link>
      <Link to="/Horseraddish/">Horseraddish</Link>
      <Link to="/Sea-lettuce/">Sea lettuce</Link>
      <Switch>
        <Route path='/beetroots' />
        <Route path='/Horseraddish' />
        <Route path='/Sea-lettuce' />
      </Switch>
      </div>
      <div className="navbar__button">
        <Button variant="success">{ t('startBuilding', { framework: "react-i18next" }) }</Button>
      </div>
  </div>
    );
  } 
}

export default translate('common')(Navbar);
